import React from 'react'

const LogOutPage = ({setLoggedIn}) => {

    const removeToken = () => {
        setLoggedIn(localStorage.removeItem("myToken"))
        // window.location.replace("/")
    }

    return (
        <button 
            type="button" 
            className="btn btn-primary btn-block"
            onClick={
                removeToken
            }
        >Log Out
        </button>

    )
}

export default LogOutPage
